import Logo from "../Logo";
import Navigation from "./Navigation";
import "./Navbar.css";

const Navbar = () => {
  return (
    <nav id="navbar">
      <div className="container nav-inner">
        <Logo />
        <Navigation />
      </div>
    </nav>
  );
};

export default Navbar;
